import React from 'react';

const Text = (props) =>{
    return(
        <div>
            { props.textLength > 5 ?
            <h4></h4>
         : 
        <h2>h2</h2>
        }  
        <h1>{props.textLength}</h1>
        </div>
    )
}

export default Text;
